import React from 'react';
import { Link } from 'react-router-dom';
import "../styles/pages/orphanages-map.css";
import 'leaflet/dist/leaflet.css';
import { CSSProperties } from "react";
function Resume(){
  return(
    <div id="page-map">
    <aside>
      <header>
        <h2>Leonardo Kenji Sato</h2>
        <p className="wellcome">Welcome to my Resume!</p>
        <p>Thecnical in Web developing but this you already know.</p> 
        <p>I'm graduating in Bacharel in Computer Science at UFABC.</p>
        <p>My english i'm happy to say is pretty nice</p>
        <p>Some languages and 'frame-works' that I have some knowledge are HTML,CSS,Python,JS,ReactJs,NODE,PHP,Mysql.</p>
        <div class="progress">
  <div className="progress-bar bg-dark" CSSProperties="'width:90%'"></div></div>
        </header>
      <footer>
        <a href="https://www.linkedin.com/in/leonardo-kenji-sato-0a495a1b7/">My LinkedIn</a>
        <Link to="/" className="enter-app"><a>About me</a></Link>
        <a href="https://github.com/LeooSato">GitHub</a>

      </footer>
    </aside>

  </div>
  )
}


export default Resume;
